import React, { useState } from "react";
import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";
import PopupWithForm from "./PopupWithForm";
import ImagePopup from "./ImagePopup";

import "../index.css";

function App() {
  const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = useState(false);
  const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = useState(false);
  const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = useState(false);

  const handleEditAvatarClick = () => {
    setIsEditAvatarPopupOpen(true);
  };

  const handleEditProfileClick = () => {
    setIsEditProfilePopupOpen(true);
  };

  const handleAddPlaceClick = () => {
    setIsAddPlacePopupOpen(true);
  };

  const closeAllPopups =  () => {
    setIsEditAvatarPopupOpen(false);
    setIsEditProfilePopupOpen(false);
    setIsAddPlacePopupOpen(false);
  };

  return (
    <div className="page">
      <Header />
      <Main
        onEditProfile={handleEditProfileClick}
        onAddPlace={handleAddPlaceClick}
        onEditAvatar={handleEditAvatarClick}
      />
      <Footer />
      {/* popups */}
      {/* avatar-popup */}
      <PopupWithForm
        title="Обновить аватар"
        name="avatar"
        id="avatar-popup"
        isOpen={isEditAvatarPopupOpen}
        onClose={closeAllPopups}
      >
        <input
          type="url"
          id="avatar"
          className="popup__input popup__input_item_avatar"
          name="avatar"
          placeholder="Ссылка на аватар"
          required
        />
        <span id="avatar-error" className="popup__error"></span>
        <button type="submit" className="popup__button">
          Сохранить
        </button>
      </PopupWithForm>

      {/* edit-popup */}
      <PopupWithForm
        title="Редактировать профиль"
        name="edit"
        id="edit-popup"
        isOpen={isEditProfilePopupOpen}
        onClose={closeAllPopups}
      >
        <input
          type="text"
          id="name"
          className="popup__input popup__input_item_name"
          name="name"
          placeholder="Жак-Ив Кусто"
          minLength="2"
          maxLength="40"
          required
        />
        <span id="name-error" className="popup__error"></span>
        <input
          type="text"
          id="about"
          className="popup__input popup__input_item_about"
          name="about"
          placeholder="Исследователь океана"
          minLength="2"
          maxLength="200"
          required
        />
        <span id="about-error" className="popup__error"></span>
        <button type="submit" className="popup__button">
          Сохранить
        </button>
      </PopupWithForm>

      {/* add-popup */}
      <PopupWithForm
        title="Новое место"
        name="add"
        id="add-popup"
        isOpen={isAddPlacePopupOpen}
        onClose={closeAllPopups}
      >
        <input
          type="text"
          id="title"
          className="popup__input popup__input_item_title"
          name="title"
          placeholder="Название"
          minLength="2"
          maxLength="30"
          required
        />
        <span id="title-error" className="popup__error"></span>
        <input
          type="url"
          id="link"
          className="popup__input popup__input_item_link"
          name="link"
          placeholder="Ссылка на картинку"
          required
        />
        <span id="link-error" className="popup__error"></span>
        <button type="submit" className="popup__button">
          Создать
        </button>
      </PopupWithForm>

      {/* delete-popup */}
      <PopupWithForm 
        title="Вы уверены?" 
        name="delete" 
        id="delete-popup">
        <button type="submit" className="popup__button popup__button-delete">
          Да
        </button>
      </PopupWithForm>

      {/* image-popup */}
      <ImagePopup />
      {/* template
      <article className="element">
        <img className="element__image" />
        <button
          type="button"
          className="element__trash"
          aria-label="Удалить"
        ></button>
        <div className="element__wrapper">
          <h2 className="element__name"></h2>
          <div>
            <button
              type="button"
              className="element__like"
              aria-label="Лайк"
            ></button>
            <p className="element__like-count"></p>
          </div>
        </div>
      </article> */}
    </div>
  );
}

export default App;
